import React from "react";

function App() {
  return (
    <div className="h-screen border-2 solid flex items-center justify-center flex-col">
      <div className="">NU</div>
      <div className="mb-5">Events </div>
      <div className="mb-20">Sign In</div>
      <form className="border-2 solid">
        <div className="w-">
          <input type="text" placeholder="Phone number..." />
        </div>
        <div>
          <input type="password" placeholder="Password..." />
        </div>

        <div className="">Forget Password?</div>
        <div className="">Sign In</div>
      </form>

      <div className="">Or</div>

      <div className="">Login with Google</div>
    </div>
  );
}

export default App;

